import React from 'react';
import {Link} from 'react-router-dom';

const NavBar = () => {
  return (
    <>
      <nav>
        <ul>
          <li><Link href="./">Home</Link></li>
          <li>About</li>
          <li>Login</li>
        </ul>
      </nav>
    </>
  )}

export default NavBar;
